import React from "react";
import { useState } from "react";

const Router = () => {

    const [num , newNum] = useState(0);

    return(
        <>
            <h1>{num}</h1>    
            <button onClick = {
                () => {
                    newNum(num++);
                }
            }>Increase Value by 1</button>
        </>
    );

}

export default Router;
